import React from 'react';
import BarChart from 'react-bar-chart';






const StockChart = () => {

    const data = [
        {text: 'Man', value: 500}, 
        {text: 'Woman', value: 300} 
      ];
      const margin = {top: 20, right: 20, bottom: 30, left: 40};



    return (
        <>
            <div style={{width: '50%'}}> 
                <BarChart ylabel='Quantity'
                  width={500}
                  height={500}
                  margin={margin}
                  data={data}
                  />
            </div>        </>
        )
}

export default StockChart;
